import dialogType from "../../services/dialogTypeRef";

export function generateDialogWithFactory(typeOfDialog, data) {
  switch (typeOfDialog) {
    case typeOfDialog === dialogType.TANGO_DETAILS: {
      return (<div>TangoDetails</div>)
    }
    default:
      return null;

  }
}
